from modules.AutoProviderPlugin import AutoProviderPlugin
from urllib.parse import urlencode, urlunparse, quote_plus
import requests
from bs4 import BeautifulSoup
import os
import re
from aplustools.web.search import Search
import json


class AutoProviderPluginAsuraToon(AutoProviderPlugin):
    def __init__(self, title, chapter, chapter_rate, data_folder, cache_folder, provider, num_workers=10):
        super().__init__(title=title, chapter=chapter, chapter_rate=chapter_rate, data_folder=data_folder,
                         cache_folder=cache_folder, provider=provider, specific_provider_website="asuratoon.com",
                         logo_path="./data/AsuraToonLogo.png", num_workers=num_workers)
        if not os.path.isfile(os.path.join(data_folder, "AsuraToonLogo.png")):
            try:
                # Using base64 is better as it won't matter if the url is ever changed, otherwise pass the url and
                # img_type="url"
                self._download_logo_image(
                    'data:image/png;base64,',
                    "AsuraToonLogo", img_format='png', img_type="base64")
            except Exception as e:
                print(f"An error occurred {e}")
                return

    def validate_image(self, image):
        file_name, file_extension, *_ = image.rsplit(".", 1) + ["", ""]
        new_name = file_name.zfill(3)

        if image[:2].isdigit():
            return file_name, file_extension, new_name, True
        return file_name, file_extension, new_name, False

    def _indirect_provider(self):
        return None

    def _search(self, query=None):
        base_url = self.specific_provider_website
        search_url = f"https://{base_url}?s={query or self.title}"

        response = requests.get(search_url)
        response.raise_for_status()

        soup = BeautifulSoup(response.content, 'html.parser')
        listupd_divs = soup.find_all('div', class_='listupd')  # There is only ever one of these

        # Dictionary to hold titles and urls
        titles_urls = {}

        # Iterate through each div to extract titles and urls
        for div in listupd_divs:
            for bsx in div.find_all('div', class_='bsx'):
                a_tag = bsx.find('a')
                if a_tag and 'href' in a_tag.attrs and 'title' in a_tag.attrs:
                    titles_urls[a_tag['title']] = a_tag['href']

        return titles_urls

    @staticmethod
    def _get_chapter_url(page_url, chapter_number):
        response = requests.get(page_url)

        if response.status_code != 200:
            return "Failed to retrieve the web page."

        soup = BeautifulSoup(response.content, 'html.parser')

        chapter_list_div = soup.find('div', id='chapterlist', class_='eplister')
        if not chapter_list_div:
            return "Chapter list not found."

        chapter_list_ul = chapter_list_div.find('ul', class_='clstyle')
        if not chapter_list_ul:
            return "Chapter list UL not found."

        chapter_url = None
        for li in chapter_list_ul.find_all('li', {"data-num": True}):
            # Extract the numeric part of the data-num attribute
            chapter_data_num = li['data-num'].split()[0]  # Get the first part of data-num, which is numeric
            try:
                if float(chapter_data_num) == chapter_number:
                    a_tag = li.find('a')
                    if a_tag and 'href' in a_tag.attrs:
                        chapter_url = a_tag['href']
                        break
            except ValueError:
                continue  # Skip non-numeric data

        return chapter_url or page_url

    def _direct_provider(self):
        response_data = self._search()
        base_url = response_data.get(next(iter(response_data)))
        chapter_url = self._get_chapter_url(base_url, self.chapter)
        if chapter_url:
            print("Found URL:" + chapter_url)  # Concatenate (add-->+) string, to avoid breaking timestamps
            return chapter_url
        return None

    def get_search_results(self, text):
        if text is None:
            return True
        response_data = self._search(text)
        return ([title, ""] for title in response_data.keys())
